import "../input.css"; // 确保引入了 Tailwind CSS

function Home() {
  return (
    <div>
      <div class="grid grid-cols-4 gap-4">
        <div>01</div>
        <div>01</div> <div>01</div> <div>01</div> <div>01</div> <div>01</div>{" "}
        <div>01</div> <div>01</div> <div>01</div> <div>01</div>
        <div>09</div>
      </div>
      <div className="h-screen w-screen gird grid-cols-2 gap-4 justify-items-center place-content-center ">
        <div className="h-1/5 w-1/5 border-2 border-orange-400 bg-black ">
          <span>moneybook</span>
          <span>moneybook</span>
        </div>
      </div>
    </div>
  );
}

export default Home;
